import React from 'react';
import './App.css';

function App() {
  const handleLogout = () => {
    // Add logout logic here
    alert('Logged out');
  };

  return (
    <div className="App">
      <div className="top-bar">
        <h1>NightTraders</h1>
        <button className="logout-button" onClick={handleLogout}>Logout</button>
      </div>
      <div className="content">
        <p>This is the gray page content.</p>
      </div>
    </div>
  );
}


export default App;
